import React from 'react'
import {useDispatch} from 'react-redux';
import {push} from 'connected-react-router';

function Login() {
  const dispatch = useDispatch()

  return (
    <div>
      <h2>ログイン</h2>
      <button onClick={() => dispatch(push('/'))}>
        ログインする
      </button>
    </div>
  )
}

export default Login
